$(document).ready(function() {
  // check for ie
  if (/msie/.test(navigator.userAgent.toLowerCase())){
  	var html = "<div id='ie_backdrop'><div id='ie_modal'><p id='ie_hello'>Hi,</p><p>It looks like you're using Internet Explorer. Unforutnately, Datavisual doesn't yet support IE.</p><p>Please use <a href='https://www.google.com/intl/en/chrome/browser/'>Chrome</a>, <a href='http://www.mozilla.org/en-US/firefox/new/'>Firefox</a>, or <a href='http://www.apple.com/safari/'>Safari</a></p><br><p>- Team Datavisual</p></div></div>"

  	$('body').css("overflow", "hidden").append(html)
  }

  if( /Android|webOS|iPhone|iPad|iPod|BlackBerry|IEMobile|Opera Mini/i.test(navigator.userAgent) && window.location.pathname != "/" ) {
    alert("Datavisual is not optimized for tiny screens, please login on a laptop or desktop computer. Thanks!")
    window.location.pathname = "/"
  }

  $('body').on('click', 'p.error', function(){
  	$('p.error').remove()
  })

  $('.profile-picture').hover(function(ev){
    var nav = $('.profile-nav')
    if (nav.hasClass('hidden')){
      nav.removeClass('hidden');
    } else {
      nav.addClass('hidden');
    }
  })
  $('.profile-nav').hover(function(ev){
    var nav = $('.profile-nav')
    if (nav.hasClass('hidden')){
      nav.removeClass('hidden');
    } else {
      nav.addClass('hidden');
    }
  })
  $('.user-orgs span').mouseover(function(ev){ $(this).siblings('a').css("background-color", "rgb(48, 140, 163)"); })
  $('.user-orgs span').mouseout(function(ev){ $(this).siblings('a').css("background-color", "rgb(90, 90, 90)"); })
  $('.user-orgs a').mouseover(function(ev){ $(this).css("background-color", "rgb(48, 140, 163)"); })
  $('.user-orgs a').mouseout(function(ev){ $(this).css("background-color", "rgb(90, 90, 90)"); })

  $('.user-orgs a').click(function(ev){
    // $(this).siblings('.active-org').removeClass('active-org');
    // $(this).siblings('.activate').addClass('active-org');
    updateOrg($(this).siblings('span'));
  });
  $('.user-orgs span').click(function(ev){
    updateOrg($(this));
  });

  $('#login-home').submit(function(e){
    e.preventDefault();

    $.ajax({
      type: "POST",
      url: $(this).attr("action"),
      data: $(this).serialize(), // serializes the form's elements.
      success: function () {
        if(window.location.pathname === '/view/') {
          window.location.reload();
        } else {
          window.location.href = '/dataDesigner';
        }
      },
      error: function()
      {
        $('#login .error').fadeIn(300).delay(1500).fadeOut(300);
      }
    });

  });
});

var updateOrg = function($el) {
  var currOrg = $el.data('org-id')
    , data = {}
    , orgId;

  currOrg ? data.orgId = currOrg : data.orgId = "";
  data.path = window.location.pathname

  $.ajax({
    type: 'POST',
    url: '/currOrg',
    data: data,
    success: function(){
      window.location.reload();
    },
    error: function(err) {
      alert('Error!');
    }
  });
}